ant(searchValue, typeof(string));//searched value constant\n                //x.property.ToString().contains(constant)\n\t\t\t\tMethodCallExpression body = Expression.Call(Expression.Call(member, toString), containsMethod, constant);\n\t\t\t\texpressionPart = Expression.Lambda<Func<T, bool>>(body, parameter);//x => x.property.contains(constant)\n\n\t\t\t\tif (expFunc == null)//Je\u017celi wyra\u017cenie nie istnieje, stw\xf3rz nowe\n\t\t\t\t{\n\t\t\t\t\texpFunc = expressionPart;\n\t\t\t\t}\n\t\t\t\telse//Je\u017celi wyra\u017cenie istnieje, doklej do niego nowe\n\t\t\t\t{\n\t\t\t\t\tvar finalBody = Expression.Or(expFunc.Body, expressionPart.Body);\n\t\t\t\t\tvar final = Expression.Lambda<Func<T, bool>>(finalBody, parameter);\n\t\t\t\t\texpFunc = final;\n\t\t\t\t}\n\t\t\t}\n\t\t\t//Na ko\u0144cu, dla np. dw\xf3ch w\u0142asno\u015bci klasy, zwr\xf3cimy: \n\t\t\t//( x => x.Property1.ToString().Contains('searchValue') || x.Property2.ToString().Contains('searchValue') )\n\t\t\treturn expFunc == null ? emptyWhere : expFunc;\n\t\t}\n    }",t.PRODUCTS_CONTROLLER_CODE="public class ProductsController : ApiController\n\t{\n\t\tProductsRepository productsRepository = new ProductsRepository();\n\n\t\t[Route(\"get_all_products\")]\n\t\tpublic async Task<ProductDtModel> GetAllProducts(int pageSize, int pageNumber, string orderByColumnName, bool sortAsc, string searchColumns, string searchValue)\n\t\t{\n\t\t\ttry\n\t\t\t{\n\t\t\t\tvar dbColumns = this.MapViewColumnsNamesToDatabaseColumnsNames(searchColumns.Split(','));\n\t\t\t\treturn await this.productsRepository.getProducts(pageSize, pageNumber, orderByColumnName, sortAsc, dbColumns, searchValue);\n\t\t\t}\n\t\t\tcatch (Exception ex)\n\t\t\t{\n\t\t\t\treturn null;\n\t\t\t}\n\t\t}\n\n\t\tprivate string[] MapViewColumnsNamesToDatabaseColumnsNames(string[] searchColumns)\n\t\t{\n\t\t\tvar n = searchColumns.Length;\n\n\t\t\tif (n <= 0)\n\t\t\t{\n\t\t\t\treturn new string[] { };\n\t\t\t}\n\n\t\t\tfor (int i = 0; i < n; i++)\n\t\t\t{\